const courses = [
  { title: "Full Stack Web Development", img: "data:image/jpeg;base64,", desc: "Learn HTML, CSS, JS, Node.js, MongoDB and React." },
  { title: "Data Science with Python", img: "data:image/jpeg;base64,", desc: "Master data analysis, machine learning and pandas." },
  { title: "Java Programming", img: "data:image/jpeg;base64,", desc: "Learn OOPs, Spring Boot and backend development." },
  { title: "UI/UX Design", img: "data:image/jpeg;base64,", desc: "Learn Figma, Adobe XD and design principles." },
  { title: "Cybersecurity Essentials", img: "data:image/jpeg;base64,", desc: "Understand firewalls, ethical hacking, and risk assessment." },
  { title: "Machine Learning", img: "data:image/jpeg;base64,", desc: "Explore algorithms, supervised and unsupervised learning." },
  { title: "Cloud Computing (AWS)", img: "data:image/jpeg;base64,", desc: "Learn cloud infrastructure and AWS deployment." },
  { title: "Mobile App Development", img: "data:image/jpeg;base64,", desc: "Build apps using Flutter and React Native." },
  { title: "Blockchain Fundamentals", img: "data:image/png;base64,", desc: "Learn smart contracts and decentralized apps." },
  { title: "DevOps Bootcamp", img: "data:image/png;base64,", desc: "Get hands-on with Docker, Jenkins, and CI/CD pipelines." },
  { title: "AI for Everyone", img: "data:image/jpeg;base64,", desc: "Understand AI applications and tools for beginners." },
  { title: "SQL & Databases", img: "data:image/png;base64,", desc: "Master MySQL, PostgreSQL, and database design." },
  { title: "C++ Programming", img: "data:image/jpeg;base64,", desc: "Build logic, DSA and competitive programming skills." },
  { title: "Data Structures & Algorithms", img: "data:image/jpeg;base64,", desc: "Prepare for coding interviews with DSA." }
];

document.addEventListener("DOMContentLoaded", () => {
  const container = document.getElementById("courseContainer");
  courses.forEach((course, index) => {
    const card = document.createElement("div");
    card.className = "card course";
    card.innerHTML = `
      <img src="${course.img}" alt="${course.title}" />
      <h3>${course.title}</h3>
    `;
    card.addEventListener("click", () => openCourse(index));
    container.appendChild(card);
  });
});

function openLogin() {
  document.getElementById("loginModal").style.display = "block";
}
function closeLogin() {
  document.getElementById("loginModal").style.display = "none";
}
function login() {
  const email = document.getElementById("email").value;
  alert("Logged in as: " + email);
  closeLogin();
}

function openCourse(index) {
  const course = courses[index];
  document.getElementById("courseTitle").textContent = course.title;
  document.getElementById("courseImage").src = course.img;
  document.getElementById("courseDescription").textContent = course.desc;
  document.getElementById("courseModal").style.display = "block";
}
function closeCourse() {
  document.getElementById("courseModal").style.display = "none";
}
function showEnrollForm() {
  document.getElementById("courseModal").style.display = "none";
  document.getElementById("enrollModal").style.display = "block";
}
function closeEnrollForm() {
  document.getElementById("enrollModal").style.display = "none";
}
function enroll() {
  const email = document.getElementById("enrollEmail").value;
  const pass = document.getElementById("enrollPassword").value;
  if (email && pass) {
    alert("Enrolled successfully with " + email);
    closeEnrollForm();
  } else {
    alert("Please enter email and password.");
  }
}
